import React from 'react'
import styles from './index.module.css'

interface TabProps {
    skills: String[];
    nameSkill: String;
    isActive: Boolean;
}


const Tab = (props: TabProps) => {
    const divsArr = []
    for(let i = 0; i < props.skills.length; i++) {
        divsArr.push(
        <li className={styles.skills_list__item}>{props.skills[i]}</li>
        )
    }
  return (
    <div className={styles.tab}>
        <div className={props.isActive || !props.isActive ? styles.tab_div_active  : styles.tab_div_dnone}>
        <h3 className={styles.tab_title}>{props.nameSkill}</h3>
        <ul className={styles.skills_list}>{divsArr}</ul>
        </div>
    </div>
  )
}

export default Tab
